(function (cs) {

    "use strict";

    // Study: Doe, Jane
    //    CT: CT SlicesCT2
    //   PET: PET NAC 2DPT2

    var ct130Base64 = ""
    var ct129Base64 = ""
    var pet180Base64 = ""
    var pet181Base64 = ""

    function pixelData2str(buf) {
        var bufView = new Uint16Array(buf);
        var len = bufView.length;
        var str = '';

        for(var i = 0; i < len; i++) {
            var word = bufView[i];
            var lower = word & 0xFF;
            var upper = (word >> 8) & 0xFF;
            str += String.fromCharCode(lower) + String.fromCharCode(upper);
        }

        return str;
    }

    function encodePixelData(pixelData) {
        var pixelDataAsString = pixelData2str(pixelData);
        var base64str = window.btoa(pixelDataAsString);
        return base64str;
    }

    function str2pixelData(str) {
        var buf = new ArrayBuffer(str.length*2); // 2 bytes for each char
        var bufView = new Int16Array(buf);
        var index = 0;
        for (var i=0, strLen=str.length; i<strLen; i+=2) {
            var lower = str.charCodeAt(i);
            var upper = str.charCodeAt(i+1);
            bufView[index] = lower + (upper <<8);
            index++;
        }
        return bufView;
    }

    function getPixelData(base64PixelData)
    {
        var pixelDataAsString = window.atob(base64PixelData);
        var pixelData = str2pixelData(pixelDataAsString);
        return pixelData;
    }

    var ct1PixelData = getPixelData(ct130Base64);
    var ct2PixelData = getPixelData(ct129Base64);
    var pet1PixelData = getPixelData(pet180Base64);
    var pet2PixelData = getPixelData(pet181Base64);

    function getCTImage(imageId) {

        var width = 512;
        var height = 512;

        function getPixelData()
        {
            if (imageId == 'ct://1') {
                return ct1PixelData;
            } else if (imageId == 'ct://2') {
            	return ct2PixelData;
            }

            throw "unknown imageId";
        }

        var image = {
            imageId: imageId,
            minPixelValue : -3024,
            maxPixelValue : 2042,
            slope: 1.0,
            intercept: 0,
            windowCenter : 40,
            windowWidth : 400,
            getPixelData: getPixelData,
            rows: height,
            columns: width,
            height: height,
            width: width,
            color: false,
            columnPixelSpacing: .976562,
            rowPixelSpacing: .976562,
            sizeInBytes: width * height * 2
        };

        var deferred = $.Deferred();
        deferred.resolve(image);
        return deferred;
    }

    function getPETImage(imageId) {
        var width = 128;
        var height = 128;

        function getPixelData()
        {
            if(imageId == 'pet://1') {
                return pet1PixelData;
            } else if (imageId == 'pet://2') {
            	return pet2PixelData;
            }

            throw "unknown imageId";
        }

        var image = {
            imageId: imageId,
            minPixelValue : 0,
            maxPixelValue : 32767,
            slope: 0.00108386,
            intercept: 0,
            windowCenter : 17.75742031,
            windowWidth : 35.51484062,
            getPixelData: getPixelData,
            rows: height,
            columns: width,
            height: height,
            width: width,
            color: false,
            columnPixelSpacing: 4.6875,
            rowPixelSpacing: 4.6875,
            sizeInBytes: width * height * 2
        };

        var deferred = $.Deferred();
        deferred.resolve(image);
        return deferred;
    }


    // register our imageLoader plugin with cornerstone
    cs.registerImageLoader('ct', getCTImage);
    cs.registerImageLoader('pet', getPETImage);
}(cornerstone));